import React from "react";
import { Car } from "../interface"

interface ICarModelProps{
    cars: Car;
}
export function CarModel(props:ICarModelProps){
    const {cars} = props;
    const {id, name, start_range, Time_to_60 ,top_speed, peak_power, base_price} = cars;
    return( 
        <div className="frame model car-img">
            <h1>{name}</h1>
        </div>
    )
}
